- (void){{CategoryPrefix}}_addBottomLineWithLeftOffset:(CGFloat)leftOffset rightOffset:(CGFloat)rightOffset {
    UIView *line = [self {{CategoryPrefix}}_getCellLineByKey:&kBottomLineKey];
    [line removeFromSuperview];
    [self.contentView addSubview:line];

    [line mas_makeConstraints:^(MASConstraintMaker *make) {
        make.bottom.equalTo(self.contentView);
