#import <objc/runtime.h>
#import "UIViewController+{{Prefix}}Loading.h"
#import "{{Prefix}}ControllerLoadingView.h"
#import "{{Prefix}}ControllerLoadingEmptyView.h"
#import "Masonry.h"

static const char *kLoadingKey;
static const char *kLoadingEmptyKey;
static const char *kLoadingErrorKey;
static const char *kRetryBlockKey;

@implementation UIViewController ({{Prefix}}Loading)

#pragma mark - Loading

- (void){{CategoryPrefix}}_showLoading {
    {{Prefix}}ControllerLoadingView *loadingView = [self {{CategoryPrefix}}_getLoadingView];
    if (!loadingView.superview) {
        [self.view addSubview:loadingView];
    }
    [self.view bringSubviewToFront:loadingView];
}

- (void){{CategoryPrefix}}_hideLoading {
    {{Prefix}}ControllerLoadingView *loadingView = [self {{CategoryPrefix}}_getLoadingView];
    if (loadingView.superview) {
        [loadingView removeFromSuperview];
    }
}

- ({{Prefix}}ControllerLoadingView *){{CategoryPrefix}}_getLoadingView {
    {{Prefix}}ControllerLoadingView *loadingView = objc_getAssociatedObject(self, &kLoadingKey);
    if (!loadingView) {
        loadingView = [[{{Prefix}}ControllerLoadingView alloc] init];
        [self.view addSubview:loadingView];
        objc_setAssociatedObject(self, &kLoadingKey, loadingView, OBJC_ASSOCIATION_RETAIN_NONATOMIC);
    }

    [loadingView mas_remakeConstraints:^(MASConstraintMaker *make) {
        make.size.equalTo(self.view);
        make.center.equalTo(self.view);
    }];

    return loadingView;
}


#pragma mark - Loading empty.

- (void){{CategoryPrefix}}_showLoadingEmpty {
    {{Prefix}}ControllerLoadingEmptyView *loadingEmptyView = [self {{CategoryPrefix}}_getLoadingEmptyView];
    if (!loadingEmptyView.superview) {
        [self.view addSubview:loadingEmptyView];
    }
    [self.view bringSubviewToFront:loadingEmptyView];
}

- (void){{CategoryPrefix}}_hideLoadingEmpty {
    {{Prefix}}ControllerLoadingEmptyView *loadingEmptyView = [self {{CategoryPrefix}}_getLoadingEmptyView];
    if (loadingEmptyView.superview) {
        [loadingEmptyView removeFromSuperview];
    }
}

- ({{Prefix}}ControllerLoadingEmptyView *){{CategoryPrefix}}_getLoadingEmptyView {
    {{Prefix}}ControllerLoadingEmptyView *loadingEmptyView = objc_getAssociatedObject(self, &kLoadingEmptyKey);
    if (!loadingEmptyView) {
        loadingEmptyView = [[{{Prefix}}ControllerLoadingEmptyView alloc] init];
        [self.view addSubview:loadingEmptyView];
        objc_setAssociatedObject(self, &kLoadingEmptyKey, loadingEmptyView, OBJC_ASSOCIATION_RETAIN_NONATOMIC);
    }

    [loadingEmptyView mas_remakeConstraints:^(MASConstraintMaker *make) {
        make.size.equalTo(self.view);
        make.center.equalTo(self.view);
    }];

    return loadingEmptyView;
}


#pragma mark - Loading error.

- (void){{CategoryPrefix}}_showLoadingErrorWithLoadingViewState:({{Prefix}}ControllerLoadingErrorState)state retryBlock:({{Prefix}}RetryLoadingBlock)block {
    [self {{CategoryPrefix}}_hideLoading];
    {{Prefix}}ControllerLoadingErrorView *loadingErrorView = [self {{CategoryPrefix}}_getLoadingErrorView];
    if (!loadingErrorView.superview) {
        [self.view addSubview:loadingErrorView];
    }
    [self.view bringSubviewToFront:loadingErrorView];

    loadingErrorView.state = state;
    objc_setAssociatedObject(self, &kRetryBlockKey, block, OBJC_ASSOCIATION_RETAIN_NONATOMIC);
}

- (void){{CategoryPrefix}}_hideLoadingError {
    {{Prefix}}ControllerLoadingErrorView *loadingErrorView = [self {{CategoryPrefix}}_getLoadingErrorView];
    if (loadingErrorView.superview) {
        [loadingErrorView removeFromSuperview];
    }
}

- ({{Prefix}}ControllerLoadingErrorView *){{CategoryPrefix}}_getLoadingErrorView {
    {{Prefix}}ControllerLoadingErrorView *loadingErrorView = objc_getAssociatedObject(self, &kLoadingErrorKey);
    if (!loadingErrorView) {
        loadingErrorView = [[{{Prefix}}ControllerLoadingErrorView alloc] init];
        [self.view addSubview:loadingErrorView];
        objc_setAssociatedObject(self, &kLoadingErrorKey, loadingErrorView, OBJC_ASSOCIATION_RETAIN_NONATOMIC);
    }

    [loadingErrorView mas_remakeConstraints:^(MASConstraintMaker *make) {
        make.size.equalTo(self.view);
        make.center.equalTo(self.view);
    }];

    return loadingErrorView;
}


#pragma mark - {{Prefix}}ControllerLoadingErrorDelegate

- (void)controllerLoadingReload {
    [self {{CategoryPrefix}}_showLoading];
    [self {{CategoryPrefix}}_hideLoadingError];
    {{Prefix}}RetryLoadingBlock retryBlock = objc_getAssociatedObject(self, &kRetryBlockKey);
    retryBlock();
}

@end

