@interface NSArray<__covariant ObjectType> ({{Prefix}}Map)
typedef _Nonnull id (^{{Prefix}}MapBlock)(ObjectType obj, NSUInteger index);
typedef BOOL (^{{Prefix}}FilterBlock)(ObjectType obj, NSUInteger index);
typedef _Nonnull ObjectType (^{{Prefix}}ReduceBlock)(ObjectType firstObj, ObjectType secondObj);

- (NSArray<ObjectType> *){{CategoryPrefix}}_mapWithBlock:({{Prefix}}MapBlock)block;
- (NSArray<ObjectType> *){{CategoryPrefix}}_filterWithBlock:({{Prefix}}FilterBlock)block;
- (ObjectType){{CategoryPrefix}}_reduceWithBlock:({{Prefix}}ReduceBlock)block;
