//

#import "NSArray+{{Prefix}}Collection.h"

@implementation NSArray ({{Prefix}}Map)
- (NSArray *){{CategoryPrefix}}_mapWithBlock:({{Prefix}}MapBlock)block {
    if (block == nil) {
        return nil; // or self?
    }

    NSMutableArray *array = [NSMutableArray array];
    [self enumerateObjectsUsingBlock:^(id  _Nonnull obj, NSUInteger idx, BOOL * _Nonnull stop) {
        id ret = block(obj, idx);
        if (ret != nil) {
            [array addObject:ret];
        }
    }];

    return array;
}

- (NSArray *){{CategoryPrefix}}_filterWithBlock:({{Prefix}}FilterBlock)block {
    if (block == nil) {
        return nil; // or self?
    }

    NSMutableArray *array = [NSMutableArray array];
    [self enumerateObjectsUsingBlock:^(id  _Nonnull obj, NSUInteger idx, BOOL * _Nonnull stop) {
        if (block(obj, idx)) {
            [array addObject:obj];
        }
    }];

    return array;
}

- (id){{CategoryPrefix}}_reduceWithBlock:({{Prefix}}ReduceBlock)block {
    if (block == nil) {
        return nil;
    }

    __block id ret = self.firstObject;

    NSArray *arr = [self {{CategoryPrefix}}_filterWithBlock:^BOOL(id  _Nonnull obj, NSUInteger index) {
        return index != 0;
    }];

    [arr enumerateObjectsUsingBlock:^(id  _Nonnull obj, NSUInteger idx, BOOL * _Nonnull stop) {
        ret = block(ret, obj);
    }];

    return ret;
}
@end

