    } else if ([version isEqualToString:@"dev"]) {
        return {{Prefix}}NetworkDevEnv;
    } else if ([version isEqualToString:@"pre"]) {
        return {{Prefix}}NetworkPreEnv;
    }

    return {{Prefix}}NetworkOnlineEnv;
}

