    NSURL *baseURL = [NSURL URLWithString:[self getBaseUrlString]];
    RKObjectManager *manager = HTNetworkingInit(baseURL);
    manager.requestSerializationMIMEType = RKMIMETypeJSON;
}

+ (NSString *)getBaseUrlString {
    switch ([self hostEnv]) {
        case {{Prefix}}NetworkDevEnv:
            return k{{Prefix}}DevBaseURL;
            break;
        case {{Prefix}}NetworkPreEnv:
            return k{{Prefix}}PreBaseURL;
            break;
        case {{Prefix}}NetworkOnlineEnv:
            return k{{Prefix}}OnlineBaseURL;
            break;
    }
